(1, 'Permohonan Kerjasama Penyuluhan UMKM dalam kegiatan program peningkatan mahasiswa Fakultas UNTAG', '2022-10-12', '09:00:00', 'Balai Desa Asemrudung Geyer Grobogan', '2022-10-03 11:09:11');
INSERT INTO `artikel` (`id_artikel`, `id_kategori`, `judul`, `slug_artikel`, `isi_artikel`, `gambar_artikel`, `visit`, `penulis`, `enabled`, `created_at`) VALUES
(1, 3, 'GAPAI MIMPI MELALUI SERAT GONI', 'gapai-mimpi-melalui-serat-goni', '<p style=\"text-align: justify;\">Erlene Handycraft merupakan UMKM yang berada di Kartasura Sukoharjo yang dirintis oleh Bu Erlina sejak tahun 2015. Berbekal keahlian menjahit untuk membuat aneka tas dan souvenir, bu Erlina memberanikan diri berinovasi pada bahan baku produknya, yakni bahan baku alami seperti kain serat goni, kancing batok kelapa, eceng gondok, serat bambu dan sebagainya. Berbagai produk telah dihasilkan melalui kerja tim pengrajin yang direkrutnya melalui pemberdayaan penduduk sekitar sebagai implementasi hasil dari mengikuti pelatihan Manajemen Operasional dan SDM yang diselenggarakan oleh Balatkop UKM Jawa Tengah.</p>\r\n<p style=\"text-align: justify;\">Produk khasnya yaitu tas dan topi berbahan baku serat goni. Kini produknya sedang menjajaki peluang export melalui kegiatan fasilitasi oleh Dinas Kabupaten setempat. Produk kerajinan berbahan baku alami memang banyak disukai oleh orang luar negeri yang notabene bergaya hidup back to nature.</p>', 'cc300f62aa27344eaac2694301f4d9d3.png', 0, 1, 1, '2022-10-02 21:33:15'),
(2, 3, 'MENDIDIK BERJIWA JUJUR BERKOPERASI', 'mendidik-berjiwa-jujur-berkoperasi', '<p style=\"text-align: justify;\">Dindagkopukm kabupaten Rembang mengadakan kegiatan pengawasan kepada gerakan koperasi pada tanggal 28 September 2022 di KPRI Karya Mulya yang diikuti oleh ibu Sulis selaku Subkor pengawasan, Awang Budiyono selaku PPKL Rembang dan Alfian staff analis koperasi.</p>\r\n<p style=\"text-align: justify;\">Bertempat di gedung serba guna KPRI Karya Mulya Kragan, team dari dinas bertemu pengawas dan pengurus koperasi yang dikoordinir oleh Bpk.Jamari, S.Pd. Materi pembinaan dan pengawasan berkaitan kelembagaan terdiri dari dokumen2 dasar koperasi, buku administrasi kelembagaan, persus-persus koperasi, sop, som dan laporan keuangan koperasi.</p>\r\n<p style=\"text-align: justify;\">Koperasi perlu dikelola secara jujur, tanggungjawab dan kompeten supaya bisa berkembang maju untuk mencapai visi, misi dan sasaran mensejahterakan anggotanya. Pengawas dan pengurus harus komitmen melaksanakan aturan secara ketat berkaitan SOP, SOM dan persus2 koperasi terutama pemberian pinjaman kepada anggota, untuk menekan angka pinjaman bermasalah.</p>\r\n<p style=\"text-align: justify;\">Harapan kedepan pengurus koperasi akan menerapkan apa yang telah diperoleh dalam kegiatan pembinaan &amp; pengawasan sehingga menjadikan koperasi tangguh dan berdaya saing dalam perspektif utama meningkatkan kesejahteraan anggotanya.</p>', '787dd88fddf48bb258b987af4188ac75.png', 0, 1, 1, '2022-10-02 21:40:00'),
(4, 3, 'Digitalisasi UMKM Permudah Akses Pembiayaan ke Bank', 'digitalisasi-umkm-permudah-akses-pembiayaan-ke-bank', '<p style=\"text-align: justify;\">Menteri Koperasi dan UKM Teten Masduki mengungkap digitalisasi&nbsp;<a href=\"https://www.liputan6.com/tag/umkm\">UMKM</a>&nbsp;bisa permudah pelaku usaha itu mendapatkan akses pembiayaan dari perbankan. Meski, ia mengakui persoalan ini masih dalam pembahasan aturan bakunya.</p>\r\n<p style=\"text-align: justify;\">Dia mengatakan kalau hambatan UMKM untuk mengakses pendanaan dari perbankan itu adalah dari sisi aset. Alasannya,&nbsp;<a href=\"https://www.liputan6.com/tag/perbankan\">perbankan</a>&nbsp;masih mensyaratkan aset penjamin untuk bisa mendapatkan dana pinjaman.</p>\r\n<p style=\"text-align: justify;\">Padahal, pemerintah tengah menggenjot upaya sebesar 30 porsi pembiayaan kredit usaha rakyat (KUR) disalurkan ke UMKM. Maka, menurutnya, dibutuhkan kemudahan lebih lanjut bagi UMKM mengakses pembiayaan.</p>\r\n<p style=\"text-align: justify;\">\"Nah rata-rata sekarang ada hambatan karena UMKM gak punya aset, banknya masih minta colateral, tapi kita ini sebenarnya kan karena UMKM itu gak punya aaset. Jadi kalau sekarang UMKM pinjam ke bank masih pakai collateral ya ini lawak terbesar, ini betul-betul&nbsp;<em>joke</em>, ya,\" ujarnya dalam Pahlawan Digital UMKM 2022, di M-Bloc Space, Senin (3/10/2022).</p>\r\n<p style=\"text-align: justify;\">\"Nah karena itu kita bisa di pemerimtah harus berubah, UMKM&nbsp;<em>go digital</em>, yang sederhana lah, pencatatan pembukuan mereka, masuk menggunakan aplikasi digital kan udah banyak kan, sehingga&nbsp;<em>track record cashflow</em>&nbsp;mereka kesehatan mereka&nbsp;<em>track record</em>&nbsp;digitalnya kan bisa di-<em>record</em>,\" tambahnya.</p>\r\n<p style=\"text-align: justify;\">Melalui langkah ini, ia percaya UMKM akan semakin mudah mengakses bantuan biaya. Dari sisi perbankan juga, menurutnya bisa memudahkan memantau kemampuan dari UMKM yang mendapatkan KUR.</p>\r\n<p style=\"text-align: justify;\">\"Nah banknya juga melakukan&nbsp;<em>credit scoring</em>, tidak harus bank sendiri, ada banyak nih teman-teman udah punya aplikasi untuk jembatani bank menggunakan&nbsp;<em>credit scoring</em>. Jadi kan untuk apa pakai agunan, ditumpuk, kalau usahanya macet kan kreditnya macet juga,\" ujarnya.</p>\r\n<p style=\"text-align: justify;\">Tanpa adanya agunan tadi, Menteri Teten melihat peluang adanya solusi bagi kedua pihak, baik UMKM maupun perbankan. Bagian ini yang sedang dimatangkan oleh&nbsp;<a href=\"https://www.liputan6.com/tag/teten-masduki\">Teten Masduki</a>.</p>\r\n<p style=\"text-align: justify;\">Menteri Koperasi dan UKM Teten Masduki menegaskan akan mengajak pelaku startup digital untuk mendorong program digitalisasi UMKM. Ini tertuang lewat Pahlawa Digital 2022 yang akan mengkurasi sekitar 20 perusahaan rintisan.</p>\r\n<p style=\"text-align: justify;\">Kedepannya, setelah dilakukan inkubasi, pendampingan, dan kurasi, Kemenkop UKM akan menggandeng startup terpilih guna mendorong akses digital UMKM. Dia percaya diri target 30 juta UMKM onboarding di 2024 bisa tercapai.</p>\r\n<p style=\"text-align: justify;\">\"Yang pertama nanti ada kolaborasi dengan Kementerian koperasi, kami akan melibatkan mereka dalam program digitalisasi UMKM dan koperasi,\" ujarnya usai mengisi acara Pahlawan Digital UMKM 2022, di M-Bloc Space, Senin (3/10/2022).</p>\r\n<p style=\"text-align: justify;\">Di sisi lain, Menteri Teten menilai kalau perusahaan rintisan digital ini memiliki peluang besar dalam segi bisnis. Misalnya, adanya potensi menarik investor guna pengembangan kedepannya.</p>\r\n<p style=\"text-align: justify;\">\"Saya kira kalau ini dari segi bsnis, yang akan lolos ini saya kita banyak yang akan tertarik menjadi investor, salah satunya yang ada divelakang saya ini, jadi malah nanti mereka akan jadi target investor. Jadi tujuan kami justru itu,\" bebernya.</p>\r\n<p style=\"text-align: justify;\">\"Kami ingin platform digital ini semakin banyak dan ini akan sangat positif bagi UMKM untuk mengakses pasar, mengakses pembiayaan modernisasi bisnis proses mereka dan seperti itu,\" tambahnya.</p>\r\n<p style=\"text-align: justify;\">Untuk diketahui, Kementerian Koperasi dan UKM, Kementerian BUMN, Kementerian Pariwisata dan Ekonomi Kreatif, serta Kementerian dalam negeri berkolaborasi mendorong tingkat digitalisasi UMKM. Ini gua mendorong rasio UMKM yang mengakses pasar digital guna memanfaatkan potensi ekonomi digital yang diprediksi tembus Rp 4.500 triliun di 2030.</p>', '537fb707090b5ea602b800147c99e8d8.jpg', 0, 1, 1, '2022-10-04 09:47:18'),
(5, 3, 'Teten Masduki Bakal Libatkan Startup demi Digitalisasi UMKM', 'teten-masduki-bakal-libatkan-startup-demi-digitalisasi-umkm', '<p>Menteri Koperasi dan UKM Teten Masduki menegaskan akan mengajak pelaku&nbsp;<a href=\"https://www.liputan6.com/tag/startup\">startup</a>&nbsp;digital untuk mendorong program digitalisasi UMKM. Ini tertuang lewat Pahlawan Digital 2022 yang akan mengkurasi sekitar 20 perusahaan rintisan.</p>\r\n<p>Kedepannya, setelah dilakukan inkubasi, pendampingan, dan kurasi, Kemenkop UKM akan menggandeng startup terpilih guna mendorong akses digital&nbsp;<a href=\"https://www.liputan6.com/tag/umkm\">UMKM</a>. Dia percaya diri target 30 juta UMKM&nbsp;<em>onboarding</em>&nbsp;di 2024 bisa tercapai.</p>\r\n<p>\"Yang pertama nanti ada kolaborasi dengan Kementerian Koperasi, kami akan melibatkan mereka dalam program digitalisasi UMKM dan koperasi,\" ujarnya usai mengisi acara Pahlawan Digital UMKM 2022, di M-Bloc Space, Senin (3/10/2022).</p>\r\n<p>Di sisi lain, Teten Masduki menilai kalau perusahaan rintisan digital ini memiliki peluang besar dalam segi bisnis. Misalnya, adanya potensi menarik investor guna pengembangan kedepannya.</p>\r\n<p>\"Saya kira kalau ini dari segi bsnis, yang akan lolos ini saya kita banyak yang akan tertarik menjadi investor, salah satunya yang ada divelakang saya ini, jadi malah nanti mereka akan jadi target investor. Jadi tujuan kami justru itu,\" bebernya.</p>\r\n<p>\"Kami ingin platform digital ini semakin banyak dan ini akan sangat positif bagi UMKM untuk mengakses pasar, mengakses pembiayaan modernisasi bisnis proses mereka dan seperti itu,\" tambahnya.</p>\r\n<p>Untuk diketahui, Kementerian Koperasi dan UKM, Kementerian BUMN, Kementerian Pariwisata dan Ekonomi Kreatif, serta Kementerian dalam negeri berkolaborasi mendorong tingkat digitalisasi UMKM. Ini gua mendorong rasio UMKM yang mengakses pasar digital guna memanfaatkan potensi ekonomi digital yang diprediksi tembus Rp 4.500 triliun di 2030.</p>\r\n<p>Sementara itu, Staf Khusus Milenial Presiden Putri Tanjung mengungkap, 20 startup digital yang terpilih saat ini punya tugas lebih besar pasca adanya inkubasi dan pendampingan. Utamanya dalam menyasar akses ke UMKM.</p>\r\n<p>Dia menuturkan, pasca inkubasi, startup akan menentukan target menggandeng UMKM dalam periode tertentu. Kemudian, evaluasi tingkat penyebaran aksesnya itu akan dilakukan setiap bulan.</p>\r\n<p>\"Jadi Pahlawan Digital ini ada KPI nya, adalah keluar dari Pahlawan Digital harus berkontribusi untuk lebih banyak lagi UMKM dan setiap bulannya akan kita tagih nih lebih banyak berpaa umkm yang ebrtambah dan dibantu,\" terangnya.</p>\r\n<p>\"Itu secara bootcampnya, 20 besar sudah terpilih, akan ada intens bootcamp dari praktisi, dan dari expert dan ada intens discuss dengan Kemenkop UKM, apa aja yang bisa dibantu dan kolaborasikan, dan disitu akan dipih 10 besar, bisa pitching didepan semua, ada venture capital, kementerian lain juga, dan ada swasta untuk bisa kolaborasi dan bantu Pahlawan Digital ini agar banyak lagi UMKM yang dibantu,\" kata dia menerangkan.</p>', '341e71872494ec9788977b00af7f0012.jpg', 0, 1, 1, '2022-10-04 09:48:27'),
(6, 2, 'Produk Ikan Kaleng dari Koperasi Binaan KKP Sukses Tembus Pasar Mancanegara', 'produk-ikan-kaleng-dari-koperasi-binaan-kkp-sukses-tembus-pasar-mancanegara', '<p>Upaya penguatan koperasi dan pelaku UMKM yang fokus dalam menghasilkan produk ikan kaleng dengan cita rasa Nusantara terus didorong oleh Kementerian Kelautan dan Perikanan (KKP). Melalui&nbsp;Ditjen Penguatan Daya Saing Produk Kelautan dan Perikanan (PDSPKP), salah satu koperasi di Kabupaten Bantul berhasil dibina untuk berkembang.</p>\r\n<p>Sebagai koperasi binaan KKP, Mina Bahari 45 memiliki peran untuk menjadi&nbsp;pengelola sentra pengolahan ikan yang dibangun oleh KKP&nbsp;di Pantai Depok Kabupaten Bantul, Yogyakarta.</p>\r\n<p>\"Ini merupakan salah satu potret koperasi perikanan yang sukses. Dapat saya laporkan bahwa salah satu unit usaha yang dilakukan oleh koperasi ini terkait dengan usaha pengolahan ikan dalam bentuk produk kaleng,\" ujar Plt Dirjen PDSPKP, Ishartini saat melakukan kunjungan kerja bersama anggota Komisi IV DPR RI ke Koperasi Mina Bahari 45 yang berada di Kabupaten Bantul, Yogyakarta kemarin, Rabu (28/9/2022).</p>\r\n<p>Ishartini mengungkapkan bahwa produk koperasi tersebut telah menjangkau area Jawa, Bali, serta luar negeri seperti Perancis, Hongkong, Kanada, Belanda, Malaysia, dan Singapura.</p>\r\n<p>Produk-produk andalannya seperti tuna balado kaleng, botok lemi telur rajungan kaleng, sup ikan patin kaleng, mangut lele kaleng, garang asem ikan patin kaleng, garang asem ikan nila kaleng, terasi panggang bubuk kaleng, dan cumi sambal ijo kaleng.</p>\r\n<p>Per bulan, unit pengolahan ikan yang telah memiliki sertifikat&nbsp;<em>Good Manufacturing Practices</em>&nbsp;(GMP), BPOM, Halal, dan HACCP ini dapat mengolah bahan baku sebesar 2,2 ton yang berasal dari nelayan lokal.</p>\r\n<p>\"Terdapat perputaran uang yang besar hingga mencapat Rp45 juta hingga Rp57 juta. Tentu ini luar biasa karena produk olahan terbukti bernilai tambah,\" ungkap Ishartini.</p>\r\n<p>Dalam kesempatan yang sama, Ishartini akan memberikan bantuan terhadap Koperasi Mina Bahari 45 dalam menyediakan tempat pengolahan bangunan&nbsp;Sentra Pengolahan Ikan yang dibangun tahun 2015 senilai Rp2,2 miliar dan mempermudah&nbsp;akses pembiayaan ke Badan Layanan Umum (BLU) Lembaga Pengelola Modal Usaha Kelautan dan Perikanan (LPMUKP) KKP tahun 2018 dengan nilai Rp2,5 miliar.</p>\r\n<p>Tak hanya itu, terdapat bantuan 2 unit<em>&nbsp;chest freezer</em>&nbsp;senilai Rp11 juta di tahun 2022,&nbsp;<em>seamer</em>&nbsp;pengalengan 1 unit, hingga fasilitasi promosi pada #pasarlautindonesia, Bangga Buatan Indonesia (BBI).</p>\r\n<p>Ishartini berharap, Koperasi Mina Bahari 45 dapat menjadi koperasi percontohan bidang usaha pengolahan dan pemasaran serta menginspirasi pelaku usaha pengolahan ikan skala mikro yang lain untuk terus mengembangkan usahanya.</p>\r\n<p>\"Kuncinya diversifikasi produk olahan bernilai tambah, memperluas akses pasar serta melaksanakan perizinan berusaha,\" katanya.</p>\r\n<h2 class=\"article-content-body__item-title\" data-component-name=\"desktop:read-page:article-content-body:section:pagetitle\">Apresiasi Diberikan</h2>\r\n<div class=\"article-content-body__item-content\" data-component-name=\"desktop:read-page:article-content-body:section:text\">\r\n<p>Sementara itu, anggota Komisi IV DPR RI, Alien Mus mengapresiasi capaian Koperasi Mina Bahari 45 termasuk kinerja dalam pengembalian dana pinjaman dari BLU KKP yang sangat cepat. Menurutnya, pertumbuhan sektor industri pengolahan ikan menjadi salah satu faktor penting yang menjadi penggerak perekonomian.</p>\r\n<p>Selain itu, Alien juga memberikan apresiasi segala bantuan dari KKP untuk pengembangan Koperasi Mina Bahari 45.</p>\r\n<p>&ldquo;Alat penutup kaleng bantuan dari KKP jelas sangat membantu Koperasi Mina Bahari dalam meningkatkan kapasitas produksinya. Sebelumnya dengan alat manual hanya mampu memproduksi 250 kaleng/hari bisa menjadi 1500 kaleng/hari,&rdquo; ujar Alien.</p>\r\n<p>Sebagai informasi, Kabupaten Bantul telah masuk menjadi salah satu daerah penerima Dana Aloksi Khusus (DAK) Tahun 2023 yang dapat digunakan untuk rehabilitasi bangunan sentra pengolahan dan perbaikan atau pengadaan peralatan sentra pengolahan.</p>\r\n<p>Selain itu, dapat digunakan untuk rehabilitasi kolam atau bak pemijahan/induk/calon induk/larva/tandon, pengadaan sarana dan prasarana budi daya ikan air tawar (nila/mas/gurami/patin/lele).</p>\r\n<p>Sebelumnya Menteri Kelautan dan Perikanan Sakti Wahyu Trenggono juga mengunjungi lokasi yang sama beberapa waktu lalu dan mengungkapkan bahwa pelaku usaha harus tanggap akan kemjuan teknologi dan tren pasar. Ia pun meminta&nbsp;pengelola sentra perikanan untuk lebih gencar lagi dalam mempromosikan dagangannya melalui&nbsp;<em>marketplace</em>&nbsp;atau sosial media.</p>\r\n<p>\"Fasilitas yang ada saya harap mendorong teman-teman di koperasi untuk terus mengembangkan usaha. Karena kegiatan ini menghasilkan perputaran ekonomi yang lumayan besar dan menyerap tenaga kerja,\" ungkapnya.</p>\r\n<p>Sejalan apa yang diminta oleh Menteri Trenggono, Ditjen PDSPKP juga telah menjalin kerja sama dengan berbagai&nbsp;<em>marketplace</em>, seperti Shopee, Grab, Gojek, dan Aruna guna meningkatkan kapasitas UMKM dalam melakukan pemasaran digital.</p>\r\n</div>', 'cb099d833a10b7779413b35a3f540888.jpeg', 0, 1, 1, '2022-10-04 09:49:41'),
(7, 2, 'Menteri Teten: Ide Anak Muda Bisa Bantu UMKM Rambah Sektor Digital', 'menteri-teten-ide-anak-muda-bisa-bantu-umkm-rambah-sektor-digital', '<p>Menteri Koperasi dan UKM Teten Masduki mengungkap alasan&nbsp; mendukung&nbsp;<a href=\"https://www.liputan6.com/tag/anak-muda\">anak muda</a>&nbsp;dalam mengembangkan&nbsp;Usaha Mikro, Kecil dan Menengah (UMKM). Hal ini karena anak muda bisa&nbsp;&nbsp;mengenalkan dan mengakselerasi digitalisasi&nbsp;kepada&nbsp;<a href=\"https://www.liputan6.com/tag/umkm\">UMKM</a>.</p>\r\n<p>Teten mengisahkan, banyak pelaku UMKM yang terdampak selama pandemi. Di sisi lain, digitalisasi jadi salah satu solusi yang bisa diakses oleh para pedagang yang terdampak pandemi.</p>\r\n<p>\"Dua tahun lalu di pandemi covid banyak anak muda yang mengembangkan inovasi yang selamatkan UMKM. Masih ingat tahun lalu warteg tidak bisa jualan, warung nasi&nbsp;tidak&nbsp; bisa jualan, muncul ide. Tukang jahit&nbsp;tidak&nbsp;bisa usaha, bakul pasar mbok-mbok (enggak&nbsp;bisa jualan),\" kata dia dalam Kick-Off Pahlawan Digital UMKM di Mbloc Space, Jakarta, Senin (3/10/2022).</p>\r\n<p>Munculnya beragam inovasi digital ini, menurut Teten bisa mengembangkan bisnis UMKM. Bahkan, perusahaan rintisan digital ini pula bisa membuat pasar baru di Indonesia.</p>\r\n<p>\"Muncul anak-anak muda yang mengembangkan aplikasi digital yang sekarang jadi bisnis bagus, pasar kan. Saya senang visi bisnisnya, ingin tolong orang di tengah kesulitan, itu yang akan berkembang,\" ujarnya.</p>\r\n<p>\"Ini jadi solusi dan bisa membangun pengembangan bersama,\" imbuh&nbsp;<a href=\"https://www.liputan6.com/tag/teten-masduki\">Teten Masduki</a>.</p>\r\n<p>Pada kesempatan yang sama, Staf Khusus Milenial Presiden Putri Tanjung memandang kalau UMKM punya potensi luar biasa. Ditambah UMKM sebagai penggerak ekonomi Indonesia.</p>\r\n<p>Dia mengaku kalau selama pandemi banyak UMKM dalam komunitas yang diikutinya mengeluh karena terdampak. Bahkan, ada yang alami kerugian besar sampai terpaksa gulung tikar.</p>\r\n<p>\"Pertanyaannya, aku bisa kontribusi apa? Sebagai pegiat UMKM aku ngobrol sama tim aku, kita setuju kayaknya kita perlu lebih banyak pahlawan digital yang bawa solusi yang bantu UMKM,\" ujarnya.</p>\r\n<p>\"Kita ngomongin hulu-hilir dari&nbsp;<em>back end</em>&nbsp;dengan teknologi. Di 2020 ada Credibook, ada banyak lagi yang<em>&nbsp;marketplace</em>&nbsp;khusus karya-karya ibu-ibu di NTT dan sebagainya. Kita perlu lebih banyak solusi UMKM yang localize,\" tambah dia.</p>\r\n<p>Sebelumnya, Kementerian Koperasi dan UKM (KemenKop UKM) menjalin sinergi dengan PT Bank Rakyat Indonesia Tbk (BRI) menghadirkan program Growpreneur by BRI di Smesco Indonesia. Program ini dihadirkan guna mendongkrak rasio kewirausahaan di Tanah Air.</p>\r\n<p>Dalam acara Grand Launching Growpreneur by&nbsp;BRI, Menteri Koperasi dan UKM (MenKop UKM) Teten Masduki mengatakan, melalui kegiatan ini diharapkan mampu mendongkrak target rasio kewirausahaan hingga 3,95 persen di 2024, serta 1 juta wirausaha mapan baru di tahun ini.</p>\r\n<p>\"Growpreneur by BRI merupakan simpul yang menghubungkan&nbsp;UMKM&nbsp;dengan industri kreatif, dan infrastruktur digital yang adaptif. Sebuah wadah program pemberdayaan komunitas UMKM BRI dan peserta Brilianpreneur.\" Kata&nbsp;Teten Masduki&nbsp;melalui sambutanya dalam peluncuran BRI Growpreneur di Smesco Indonesia, seperti ditulis Jumat (16/9/2022).</p>\r\n<p>Teten mengapresiasi bahwa BRI senantiasa menjadi mitra KemenKopUKM untuk menjadi garda terdepan dalam menaikkelaskan UMKM Indonesia, serta menciptakan ekosistem komplit yang mengkoneksikan UMKM dengan kewirausahaan.</p>\r\n<p>\"Bersama dukungan BRI, saya pribadi optimistis dan percaya diri bahwa kita bisa mencapai target kewirausahaan. Karena Pemerintah tak bisa sendiri, perlu ada kerja sama dari semua pihak. Dan memang ini adalah perintah Presiden Joko Widodo (Jokowi) dalam meningkatkan kewirausahaan,\" ucapnya dalam keterangan tertulis.</p>\r\n<p>Dalam mendukung pertumbuhan&nbsp;UMKM&nbsp;agar naik kelas, Kamar Dagang dan Industri (KADIN) Indonesia menggelar acara dan forum diskusi \"Gerakan Kemitraan Inklusif untuk UMKM Naik Kelas\" yang diresmikan oleh Presiden Joko Widodo (Jokowi) di SMESCO Indonesia, Jakarta, Senin (3/10/2022).</p>\r\n<p>Bagi&nbsp;KADIN Indonesia, UMKM memiliki peranan krusial dalam perekonomian Indonesia sehingga perlu dikuatkan, diberdayakan dan digandeng untuk semakin tumbuh dan mampu menembus pasar global. UMKM sendiri telah berkontribusi sebesar 61.97 persen dari total PDB nasional, atau setara dengan Rp 8.500 triliun pada tahun 2020.</p>\r\n<p>Pemerintah sendiri terus mendorong pemberdayaan UMKM. Presiden Jokowi mencanangkan program Economic Empowerment sebagai gerakan nasional Indonesia untuk memperkuat perekonomian Indonesia di dalam banyaknya tantangan-tantangan global.</p>\r\n<p>Tak hanya itu, mendiskusikan UMKM menjadi salah satu prioritas utama Presiden Jokowi bagi Indonesia dalam forum multilateral G20.</p>\r\n<p>\"Saat ini kondisi perekonomian dunia di posisi yang tidak baik-baik saja. Ketidakpastiannya sangat tinggi. Pandemi memang sudah mereda, namun perekonomian dunia masih belum kembali normal. Kondisi akan lebih sulit dengan adanya perang Rusia-Ukraina yang memantik krisis finansial, pangan, energi dan lainnya. Namun, kita percaya Indonesia mampu melewatinya. Ini terbukti dengan pertumbuhan ekonomi kuartal II yang masih bisa tumbuh 5,4 persen,\" jelas Presiden Jokowi saat meresmikan acara Gerakan Kemitraan Inklusif untuk UMKM Naik Kelas, Senin (3/10/2022).</p>', '788eeafa379b8e375ad73dce2c6b7654.jpg', 0, 1, 1, '2022-10-04 09:50:45'),
(8, 2, 'Luas Biasa, Kontribusi UMKM ke PDB Capai Rp 8.574 Triliun', 'luas-biasa-kontribusi-umkm-ke-pdb-capai-rp-8-574-triliun', '<p>Menteri Koordinator Bidang Perekonomian Airlangga Hartarto menyatakan usaha mikro kecil menengah (<a href=\"https://www.liputan6.com/tag/umkm\">UMKM</a>) telah menjadi pendukung ketahanan perekonomian karena kontribusinya terhadap Produk Domestik Bruto (PDB) mencapai 61,07 persen atau senilai Rp 8.574 triliun pada 2021.</p>\r\n<p>&ldquo;UMKM telah memiliki jumlah sektor bisnis pada 2021 yang mencapai 64,19 juta dan telah berkontribusi terhadap&nbsp;<a href=\"https://www.liputan6.com/tag/pdb\">PDB</a>&nbsp;hingga 61,07 persen atau senilai Rp8.574 triliun,&rdquo; katanya dikutip dari Antara, Senin (3/10/2022).</p>\r\n<div data-cache-key=\"https_liputan6.com:bump:TextTypeArticle#5087114::isNotMobile::4ede5551b68d2e5ff4fa301364189a4a\" data-cache-ttl=\"360\" data-component-name=\"desktop:read-page:article-content-body:section:bacajuga\">\r\n<div class=\"baca-juga-collections\" data-category=\"Ekonomi\">\r\n<div class=\"enamplus-gateway\">\r\n<p>Airlangga menjelaskan UMKM mampu mendukung PDB Indonesia karena pemerintah menempuh sejumlah upaya untuk dapat mendorong kemajuannya yang salah satunya melalui pelaksanaan Undang-Undang Nomor 11 Tahun 2020 tentang Cipta Kerja.</p>\r\n<p>Pemerintah juga memberikan bantuan pembiayaan melalui kredit usaha rakyat (KUR) dengan plafon tahun 2022 sebesar Rp373,17 triliun dan tahun depan meningkat menjadi Rp470 triliun.</p>\r\n<p>Selain itu, sesuai arahan Presiden Joko Widodo maka porsi kredit UMKM ditingkatkan menjadi 30 persen pada 2024 sedangkan saat ini porsi kredit UMKM terhadap total kredit baru sebesar 18,4 persen.</p>\r\n<p>Kemudian melalui Inpres Nomor 4 Tahun 2022, Presiden Joko Widodo turut mengamanatkan kepada Kementerian/Lembaga (K/L) dan pemerintah daerah agar dapat mengambil langkah-langkah untuk mempercepat penghapusan kemiskinan ekstrem.</p>\r\n<p>&ldquo;Itu dilakukan dengan melaksanakan kolaborasi kemitraan program penghapusan&nbsp;<a href=\"https://www.liputan6.com/tag/kemiskinan-ekstrem\">kemiskinan ekstrem</a>&nbsp;dengan pemangku kepentingan di luar pemerintah,&rdquo; ujar Airlangga.</p>\r\n<p>Pemerintah melalui Kementerian Koordinator Bidang Perekonomian pun melakukan penandatanganan nota kesepahaman dengan Kamar Dagang dan Industri (Kadin) Indonesia mengenai Kemitraan Multi-Pihak Percepatan Penghapusan Kemiskinan Ekstrem.</p>\r\n<p>Kemitraan ini akan memberikan kemudahan dalam melakukan identifikasi, perencanaan dan percontohan bagi daerah-daerah sehingga dapat menghasilkan data terkait Percepatan Penghapusan Kemiskinan Ekstrem (P3KE).</p>\r\n<p>Data P3KE akan digunakan sebagai rujukan dalam pencapaian sasaran program Corporate Social Responsibility (CSR) atau program Tanggung Jawab Sosial dan Lingkungan (TJSL) yang ditujukan untuk mengentaskan kemiskinan ekstrem di sekitar lokasi perusahaan.</p>\r\n<p>Pelaksanaan program CSR saat ini didukung dengan penyusunan revisi Peraturan Pemerintah Nomor 47 Tahun 2021 tentang TJSL Perseroan Terbatas.</p>\r\n<p>Peraturan tersebut mengatur keberadaan CSR di sekitar lokasi perusahaan dengan radius tertentu yang masih diperhitungkan pemerintah dengan proyeksi minimal berada di kabupaten/kota yang sama dengan lokasi perusahaan.</p>\r\n<p>&ldquo;Melalui sistem ini Kadin bisa melaksanakannya dengan percontohan yang ada dan sesuai arahan Presiden untuk bisa direplikasi,&ldquo; tegas Airlangga.</p>\r\n<p>Dalam mendukung pertumbuhan&nbsp;UMKM&nbsp;agar naik kelas, Kamar Dagang dan Industri (KADIN) Indonesia menggelar acara dan forum diskusi &ldquo;Gerakan Kemitraan Inklusif untuk UMKM Naik Kelas&rdquo; yang diresmikan oleh Presiden Joko Widodo (Jokowi) di SMESCO Indonesia, Jakarta, Senin (3/10/2022).</p>\r\n<p>Bagi&nbsp;KADIN Indonesia, UMKM memiliki peranan krusial dalam perekonomian Indonesia sehingga perlu dikuatkan, diberdayakan dan digandeng untuk semakin tumbuh dan mampu menembus pasar global. UMKM sendiri telah berkontribusi sebesar 61.97 persen dari total PDB nasional, atau setara dengan Rp 8.500 triliun pada tahun 2020.</p>\r\n<p>Pemerintah sendiri terus mendorong pemberdayaan UMKM. Presiden Jokowi mencanangkan program Economic Empowerment sebagai gerakan nasional Indonesia untuk memperkuat perekonomian Indonesia di dalam banyaknya tantangan-tantangan global.</p>\r\n<p>Tak hanya itu, mendiskusikan UMKM menjadi salah satu prioritas utama Presiden Jokowi bagi Indonesia dalam forum multilateral G20.</p>\r\n<p>&ldquo;Saat ini kondisi perekonomian dunia di posisi yang tidak baik-baik saja. Ketidakpastiannya sangat tinggi. Pandemi memang sudah mereda, namun perekonomian dunia masih belum kembali normal. Kondisi akan lebih sulit dengan adanya perang Rusia-Ukraina yang memantik krisis finansial, pangan, energi dan lainnya. Namun, kita percaya Indonesia mampu melewatinya. Ini terbukti dengan pertumbuhan ekonomi kuartal II yang masih bisa tumbuh 5,4 persen,&rdquo; jelas Presiden Jokowi saat meresmikan acara Gerakan Kemitraan Inklusif untuk UMKM Naik Kelas, Senin (3/10/2022).</p>\r\n<p>Presiden juga meyakini, di kuartal-kuartal berikutnya perekonomian nasional akan terus tumbuh di atas angka yang ditargetkan. Kunci keberhasilannya, kata Presiden, adalah dengan berkolaborasi, kompak karena tantangan kita tidak mudah dan cukup berat.</p>\r\n<p>Presiden Jokowi juga menekankan perlu adanya Indonesia Incorporated agar perusahaan yang besar, menengah, kecil bekerjasama, berkolaborasi bersama menyelesaikan persoalan di lapangan secara konkret.</p>\r\n<p>&ldquo;Pemerintah sulit mendampingi UMKM atau petani, yang bisa langsung mengawal adalah pihak swasta dan akan berhasil jika ada gerakan kemitraan seperti yang diinisiasi oleh KADIN Indonesia,&rdquo; tambah Jokowi.</p>\r\n</div>\r\n</div>\r\n</div>', '20fb2eeea4cb80a0986cb0debd881b11.jpg', 0, 1, 1, '2022-10-04 09:52:02'),
(9, 2, 'Menko Airlangga: Plafon KUR 2023 Naik jadi Rp 470 Triliun', 'menko-airlangga-plafon-kur-2023-naik-jadi-rp-470-triliun', '<p>Pengentasan kemiskinan ekstrem telah menjadi fokus Pemerintah untuk dapat ditangani dengan lebih baik, salah satunya dengan melakukan pengembangan&nbsp;<a href=\"https://www.liputan6.com/tag/umkm\">UMKM</a>.</p>\r\n<p>Sebagai primadona Pemerintah dalam mendukung ketahanan perekonomian nasional, UMKM telah memiliki jumlah sektor bisnis pada 2021 yang mencapai 64,19 juta dan telah berkontribusi terhadap Produk Domestik Bruto hingga 61,07 persen atau senilai Rp8.574 triliun.</p>\r\n<p>Dalam acara Gerakan Nasional Kemitraan Inklusif Untuk UMKM Naik Kelas, Senin (3/10), Menteri Koordinator Bidang Perekonomian Airlangga Hartarto menyampaikan bahwa Pemerintah telah menempuh sejumlah upaya untuk dapat mendorong kemajuan UMKM dan salah satunya melalui pelaksanaan Undang-Undang Nomor 11 Tahun 2020 tentang Cipta Kerja yang telah memberikan kemudahan, perlindungan, serta pemberdayaan bagi UMKM.</p>\r\n<p>&ldquo;Pemerintah juga telah memberikan bantuan pembiayaan melalui&nbsp;<a href=\"https://www.liputan6.com/tag/kur\">KUR</a>&nbsp;dengan plafon tahun 2022 sebesar Rp373,17 triliun dan tahun depan akan meningkat menjadi Rp470 triliun, dan sesuai arahan Presiden porsi kredit UMKM ditingkatkan menjadi 30 persen pada tahun 2024, sedangkan saat ini porsi kredit UMKM terhadap total kredit baru sebesar 18,4 persen,&rdquo; ungkap Menko Airlangga.</p>\r\n<p>Selain berbagai upaya pembedayaan UMKM tersebut, melalui Inpres Nomor 4 Tahun 2022, Presiden Joko Widodo juga telah mengamanatkan kepada Kementerian/Lembaga dan Pemerintah Daerah agar dapat mengambil langkah-langkah&nbsp; untuk melakukan percepatan penghapusan kemiskinan ekstrem dengan melaksanakan kolaborasi kemitraan program penghapusan kemiskinan ekstrem dengan pemangku kepentingan di luar Pemerintah.</p>\r\n<p>Untuk itu pada kesempatan yang sama, Pemerintah melalui Kementerian Koordinator Bidang Perekonomian juga melakukan penandatanganan nota kesepahaman dengan Kamar Dagang dan Industri (Kadin) Indonesia mengenai Kemitraan Multi-Pihak Percepatan Penghapusan&nbsp;<a href=\"https://www.liputan6.com/tag/kemiskinan-ekstrem\">Kemiskinan Ekstrem</a></p>\r\n<p>Hal ini akan memberikan kemudahan dalam melakukan identifikasi, perencanaan, dan percontohan bagi daerah-daerah sehingga dapat menghasilkan data terkait Percepatan Penghapusan Kemiskinan Ekstrem (P3KE) yang akan digunakan sebagai rujukan dalam pensasaran program CSR (Corporate Social Responsibility) atau program TJSL (Tanggung Jawab Sosial dan Lingkungan).</p>\r\n<p>Adapun sebagai program yang ditujukan untuk mengentaskan kemiskinan ekstrem di sekitar lokasi perusahaan, pelaksanaan program CSR saat ini didukung dengan penyusunan revisi Peraturan Pemerintah Nomor 47 Tahun 2021 tentang TJSL Perseroan Terbatas guna mengatur keberadaan CSR di sekitar lokasi perusahaan dengan radius tertentu yang masih diperhitungkan Pemerintah dengan proyeksi minimal berada di kabupaten/kota yang sama dengan lokasi perusahaan.</p>\r\n<p>&ldquo;Dengan sistem ini tentu Kadin bisa melaksanakannya dengan percontohan yang ada dan sesuai arahan Presiden untuk bisa direplikasi, untuk itu Pemerintah mengapresiasi inisiatif Kadin dan selanjutnya dapat mohon arahan lebih lanjut dari Presiden,&rdquo; pungkas Menko Airlangga.</p>\r\n<p>Presiden Joko Widodo yang hadir langsung pada kegiatan tersebut, memberikan arahan agar seluruh pihak baik Pemerintah maupun pihak swasta dapat berkolaborasi menyelesaikan berbagai persoalan secara konkret seperti halnya dengan pengentasan kemiskinan ekstrem. Selain itu, Presiden Joko Widodo juga berpesan agar dapat dilakukan pendampingan terkait usaha komoditas masyarakat untuk mendorong perolehan hasil yang optimal melalui gerakan-gerakan kemitraan tersebut.</p>\r\n<p>&ldquo;Jika ini bisa berjalan, saya yakini bisa berefek kepada kemiskinan ekstrem yang akan bisa ditangani dengan cepat dan baik,&rdquo; ujar Presiden Joko Widodo.</p>\r\n<p>Turut hadir dalam kegiatan tersebut diantaranya yakni Presiden Republik Indonesia, Menteri Sekretaris Negara, Menteri Koperasi dan Usaha Mikro, Kecil, dan Menengah, Menteri Hukum dan Hak Asasi Manusia, serta Ketua Umum Kamar Dagang dan Industri (Kadin) Indonesia.</p>', '74c1bdddf85358bf5d3c0a586eb75c18.jpeg', 0, 1, 1, '2022-10-04 09:53:27'),
(10, 2, 'Bantu UMKM Naik Kelas, Jokowi Luncurkan Gerakan Kemitraan Inklusif', 'bantu-umkm-naik-kelas-jokowi-luncurkan-gerakan-kemitraan-inklusif', '<p>Dalam mendukung pertumbuhan&nbsp;<a href=\"https://www.liputan6.com/tag/umkm\">UMKM</a>&nbsp;agar naik kelas, Kamar Dagang dan Industri (KADIN) Indonesia menggelar acara dan forum diskusi &ldquo;Gerakan Kemitraan Inklusif untuk UMKM Naik Kelas&rdquo; yang diresmikan oleh Presiden Joko Widodo (Jokowi) di SMESCO Indonesia, Jakarta, Senin (3/10/2022).</p>\r\n<p>Bagi&nbsp;<a href=\"https://www.liputan6.com/tag/kadin-indonesia\">KADIN Indonesia</a>, UMKM memiliki peranan krusial dalam perekonomian Indonesia sehingga perlu dikuatkan, diberdayakan dan digandeng untuk semakin tumbuh dan mampu menembus pasar global. UMKM sendiri telah berkontribusi sebesar 61.97 persen dari total PDB nasional, atau setara dengan Rp 8.500 triliun pada tahun 2020.</p>\r\n<p>Pemerintah sendiri terus mendorong pemberdayaan UMKM. Presiden Jokowi mencanangkan program Economic Empowerment sebagai gerakan nasional Indonesia untuk memperkuat perekonomian Indonesia di dalam banyaknya tantangan-tantangan global.</p>\r\n<p>Tak hanya itu, mendiskusikan UMKM menjadi salah satu prioritas utama Presiden Jokowi bagi Indonesia dalam forum multilateral G20.</p>\r\n<p>&ldquo;Saat ini kondisi perekonomian dunia di posisi yang tidak baik-baik saja. Ketidakpastiannya sangat tinggi. Pandemi memang sudah mereda, namun perekonomian dunia masih belum kembali normal. Kondisi akan lebih sulit dengan adanya perang Rusia-Ukraina yang memantik krisis finansial, pangan, energi dan lainnya. Namun, kita percaya Indonesia mampu melewatinya. Ini terbukti dengan pertumbuhan ekonomi kuartal II yang masih bisa tumbuh 5,4 persen,&rdquo; jelas Presiden Jokowi saat meresmikan acara Gerakan Kemitraan Inklusif untuk UMKM Naik Kelas, Senin (3/10/2022).</p>\r\n<p>Presiden juga meyakini, di kuartal-kuartal berikutnya perekonomian nasional akan terus tumbuh di atas angka yang ditargetkan. Kunci keberhasilannya, kata Presiden, adalah dengan berkolaborasi, kompak karena tantangan kita tidak mudah dan cukup berat.</p>\r\n<p>Presiden Jokowi juga menekankan perlu adanya Indonesia Incorporated agar perusahaan yang besar, menengah, kecil bekerjasama, berkolaborasi bersama menyelesaikan persoalan di lapangan secara konkret.</p>\r\n<p>&ldquo;Pemerintah sulit mendampingi UMKM atau petani, yang bisa langsung mengawal adalah pihak swasta dan akan berhasil jika ada gerakan kemitraan seperti yang diinisiasi oleh KADIN Indonesia,&rdquo; tambah Jokowi.</p>', 'a6d36e19d13a46f39c1d02d8a3e3373f.jpg', 0, 1, 1, '2022-10-04 09:54:26'),
(11, 3, 'Jokowi: Jangan Sampai Ada Pabrik Besar tapi Lingkungan Sekitarnya Miskin', 'jokowi-jangan-sampai-ada-pabrik-besar-tapi-lingkungan-sekitarnya-miskin', '<p>Presiden Joko Widodo (Jokowi) mengemukakan soal pentingnya keterlibatan korporasi dalam bina lingkungan. Hal ini disampaikan&nbsp;<a href=\"https://www.liputan6.com/tag/jokowi\">Jokowi</a> saat bertemu dengan pembudidaya madu hutan dari Jambi, binaan Asia Pulp &amp; Paper (APP) Sinar Mas.</p>\r\n<p>&ldquo;Jangan sampai perusahaan besar ada di suatu daerah, pabriknya terlihat besar, namun lingkungan sekitarnya&nbsp;<a href=\"https://www.liputan6.com/tag/miskin\">miskin</a>. Pemerintah tidak mungkin melakukan itu sendirian, yang bisa dan cepat adalah jika ada gerakan kemitraan,\" kata dia dalam keterangan tertulis di Jakarta, Senin (3/10/2022).</p>\r\n<p>\"Seperti madu, biasanya dimasukkan botol dan dijual di pasar, namun dengan packaging yang bagus dan branding produk yang baik, dapat menaikkan harga jual berkali-kali lipat. Sentuhan seperti itu yang diharapkan. Jika bisa, bukan hanya dipasarkan ke pasar lokal atau domestik, namun juga dibawa ke pasar ekspor,\" lanjutnya.</p>\r\n<p>Jokowi juga menyampaikan tantangan&nbsp;<a href=\"https://www.liputan6.com/tag/pemulihan-ekonomi\">pemulihan ekonomi</a>&nbsp;dunia jelang meredanya pandemi adalah ancaman krisis finansial, energi serta pangan.</p>\r\n<p>&ldquo;Perekonomian Indonesia pada kuartal II mampu tumbuh sebesar 5,44 persen, dan saya meyakini di kuartal ketiga masih bisa tumbuh diatas angka tersebut. Kuncinya kita semua harus kompak, bersinergi, dan memiliki perasaan yang sama karena yang kita hadapi adalah sebuah tantangan yang tidak mudah. Perlu yang namanya Indonesia Incorporated,\" jelas Jokowi.</p>\r\n<p>\"Yang besar, yang menengah, yang kecil, semuanya bekerjasama dan berkolaborasi menyelesaikan persoalan secara konkret dan nyata,&rdquo;&nbsp;tururnya.</p>\r\n<p>Sementara itu, belajar dari formula keberhasilan terdahulu, mengadopsi kiat keberhasilan negara lain, kemudian menggandeng lintas pihak untuk membangun ekosistemnya, demikian sektor usaha yang bernaung dalam Kamar Dagang dan Industri Nasional Indonesia memberikan dukungannya pada upaya pemerintah menaikkelaskan usaha mikro, kecil dan menengah.</p>\r\n<p>&ldquo;Sektor usaha memadukan inisiatif yang selama ini efektif memberdayakan perekonomian masyarakat, seperti skema Inclusive Closed Loop Flying Wheel, dengan modul dari berbagai negara yang berhasil menjadikan UMKM sebagai kekuatan ekonomi mereka,&rdquo; kata Koordinator Wakil Ketua Umum II Bidang Perekonomian KADIN, Franky O. Widjaja dalam diskusi, eksebisi dan peluncuran &lsquo;Gerakan Kemitraan Inklusif untuk UMKM Naik Kelas&rsquo; di Smesco, Jakarta.</p>\r\n<p>Pertumbuhan pesat ekonomi digital di Indonesia sepanjang pandemi menurut Franky dapat menjadi momentum mempercepat masuknya UMKM ke dalam rantai pasok industri. Model Inclusive Closed Loop Flying Wheel, selama ini dimanfaatkan industri kelapa sawit dalam bentuk kemitraan bersama para petani, yang lebih dikenal dengan inti dan plasma.</p>\r\n<p>Di mana perusahaan memberikan pendampingan dalam praktik agribisnis terbaik hingga produksi petani meningkat secara berkelanjutan, begitu pula kesejahteraan mereka.</p>\r\n<p>&ldquo;Para petani mendapatkan pelatihan praktik pertanian, akses pada bibit unggul dan pupuk, dukungan pendanaan, pendidikan literasi keuangan, dukungan teknologi tepat guna, berikut jaminan pembelian produk (offtaker) oleh perusahaan,&rdquo; ujarnya. KADIN sejak 2010 bersama pemerintah, perguruan tinggi dan tembaga riset, telah berupaya memperluas inisiatif ini menjangkau produk pangan strategis lainnya, dan pada tahun depan menargetkan dapat memberikan pendampingan bagi 2 juta petani.</p>\r\n<p>&ldquo;Kami berupaya agar skema ini dapat pula dimanfaatkan sektor UMKM, mengantar mereka sebagai bagian rantai pasok global, yang berarti menaikkelaskan diri mereka lewat sebuah ekosistem di mana hadir pendampingan pemerintah dan korporasi,&rdquo; kata Ketua Umum Eka Tjipta Foundation, Hong Tjhin di kesempatan yang sama.</p>\r\n<p>Keberadaan UMKM sangat penting guna mengungkit perekonomian Indonesia karena menurut Kementerian Koperasi dan UMKM, tahun lalu jumlahnya mencapai 64,2 juta, dengan kontribusi terhadap PDB hingga sebesar 61,07 persen atau senilai Rp8.573,89 triliun. Sektor ini juga menjadi gantungan hidup sekitar 117 juta pekerja yang mayoritas kaum perempuan (64,5 persen).</p>', 'b2c97d4d1607d1eb9235a77aab2aa50d.jpg', 0, 1, 1, '2022-10-04 09:55:32'),
(12, 2, 'Jokowi ke Perusahaan Besar di Daerah: Jangan Sampai Pabrik Besar, Lingkungannya Miskin', 'jokowi-ke-perusahaan-besar-di-daerah-jangan-sampai-pabrik-besar-lingkungannya-miskin', '<p>Presiden Joko Widodo atau&nbsp;<a href=\"https://www.liputan6.com/tag/jokowi\">Jokowi</a>&nbsp;meminta perusahaan besar di daerah untuk memberi pendampingan kepada petani atau pelaku usaha kecil agar bisa berkembang. Jokowi mengingatkan agar jangan sampai perusahaan besar di daerah berkembang pesat, namun lingkungan sekitarnya justru miskin.</p>\r\n<p>\"Jangan sampai ada perusahaan besar berada di sebuah daerah, pabriknya kelihatan tinggi-tinggi dan besar sekali, lingkungannya miskin. Hati-hati. Bina lingkungan itu sangat penting, warung-warungnya kumuh,\" kata Jokowi saat menyampaikan sambutan di Peluncuran Gerakan Kemitraan Inklusif untuk&nbsp;<a href=\"https://www.liputan6.com/tag/umkm\">UMKM</a>&nbsp;Naik Kelas di Jakarta, Senin (3/10/2022).</p>\r\n<p>Dia mengatakan,&nbsp;<a href=\"https://www.liputan6.com/tag/perusahaan-besar\">perusahaan besar</a>&nbsp;tersebut bisa memberikan pembinaan kepada warung-warung dalam hal penataan barang ataupun perbaikan kemasan. Jokowi menyebut pemerintah tak bisa melakukan hal itu semuanya kepada warung-warung di daerah.</p>\r\n<p>\"Ada pembinaan warung-warung sehingga penataan barangnya baik, packaging dari produk-produk yang ada didampingi. Ini yang kita harapkan. Pemerintah tidak mungkin melakukan itu, yang bisa dan cepat melakukan adalah kalau ada gerakan kemitraan,\" ujar Jokowi.</p>\r\n<p>Jokowi mencontohkan pendampingan yang dilakukan&nbsp;<a href=\"https://www.liputan6.com/tag/perusahaan\">perusahaan</a>&nbsp;besar kepada penjual madu. Menurut dia, pendampingan itu membuat kemasan dan branding madu tersebut menjadi lebih baik serta harga jualnya naik dua sampai tiga kali lipat.</p>\r\n<p>\"Hal-hal, sentuhan-sentuhan seperti itu yang kita harapkan dan marketnya kalau bisa pasarnya tidak hanya pasar lokal, tidak hanya pasar domestik, tapi bisa dibawa untuk pasar ekspor. Ini yg kita harapkan,\" tutur Jokowi.</p>\r\n<p>Dia meyampaikan pabrik otomotif yang berdiri di Indonesia juga harus bermitra dengan usaha kecil menengah (UKM) industri. Misalnya, membiarkan pelaku UKM membuat knalpotnya, kaca spion, atau mengerjakan interior kursi.</p>\r\n<p>\"Artinya, kalau ini bisa berjalan saya meyakini akan berefek pada kemiskinan ekstrem yang akan bisa tertangani dengan cepat dan baik,\" pungkas Jokowi.</p>', '0b98f8a01cd4f1cbc5b6fb5e622cd31f.jpg', 0, 1, 1, '2022-10-04 09:56:25');
