INSERT INTO `konsultasi` (`id_konsultasi`, `kode_pesan`, `kode_berkas`, `kategori`, `isi_pesan`, `pengirim`, `penerima`, `parent`, `status`, `is_read`, `tgl_pengiriman`) VALUES
(1, '1DV44LLjUe1TrQ5g', 'akD9AqF6LX9M11J2', 7, '<p>Assalamualaikum,</p>\r\n<p>Saya mau konsultasi mengenai pembuatan izin usaha. Untuk pengurusan izin usaha itu bagaimana dan berkas pendaftaran ada apa-apa saja ya, saya belum paham mengenai tata cara pengurusannya.</p>\r\n<p>Mohon arahannya.</p>', 13, 14, NULL, 1, 1, '2022-10-06 00:58:04'),
(4, '1DV44LLjUe1TrQ5g', 'jbM6Qn4OjCx69mEm', 7, '<p>Bagi para pengusaha (baik itu usaha mikro, kecil, ataupun menengah) memiliki surat perizinan merupakan hal yang penting, dimanapun mereka ingin membangun sebuah usaha. Tidak terkecuali jika ingin mendirikan usaha di desa.</p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Surat tersebut juga dapat menjadi bukti resmi bagi pelaku usaha untuk menjalankan usahanya atau untuk mendirikan sebuah usaha, terutama di desa.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Surat izin usaha untuk kategori usaha mikro sering dikenal dengan SIUP Mikro atau IUMK (Surat Izin Usaha Mikro Kecil). Surat izin usaha mikro digolongkan untuk pemilik usaha dengan modal dan kekayaan bersih tidak lebih dari 50 juta (tidak termasuk tanah &amp; bangunan tempat usaha).</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Untuk itu kalian perlu memahami prosedur surat tersebut dengan baik, agar kelak proses pengurusan surat izin usaha untuk bisnis kalian bisa berjalan dengan lancar.</span></p>\r\n<p><strong><span lang=\"EN-GB\">Syarat Mengurus Surat Izin Usaha Mikro Kecil (IUMK)</span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Untuk mendapatkan Surat Izin Usaha Mikro Kecil (IUMK) ada persyaratan yang wajib disiapkan, berikut ini kelengkapan berkas yang menjadi persyaratan untuk mengurus IUMK:</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\"><span lang=\"EN-GB\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"EN-GB\">Surat pengantar dari RT/RW terkait lokasi usaha</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span lang=\"EN-GB\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"EN-GB\">Kartu Tanda Penduduk (KTP) yang masih berlaku</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span lang=\"EN-GB\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"EN-GB\">Kartu Keluarga (KK)</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span lang=\"EN-GB\">4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"EN-GB\">Pas foto berwarna ukuran 4&times;6 cm (2 lembar)</span></p>\r\n<p class=\"MsoListParagraphCxSpLast\"><span lang=\"EN-GB\">5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"EN-GB\">Mengisi formulir IUMK yang telah tersedia</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Namun syarat di atas bisa saja berubah sewaktu-waktu (berdasarkan peraturan yang berlaku di desa atau daerah lain), untuk kejelasan mengenai persyaratan mengurus surat IUMK bisa ditanyakan langsung di kantor desa setempat.</span></p>\r\n<p><strong><span lang=\"EN-GB\">Jenis Usaha yang Wajib dan yang Tidak Wajib Memiliki SIUP</span></strong></p>\r\n<p><span lang=\"EN-GB\">Pada dasarnya, semua jenis usaha perdagangan perlu memiliki surat-surat sebagai bukti izin usaha. Namun, berdasarkan Peraturan Menteri (</span><strong><span lang=\"EN-GB\">Pasal 4 ayat (1) Peraturan Menteri Perdagangan No. 46/M-DAG/PER/9/2009)</span></strong><strong><span lang=\"EN-GB\">&nbsp;</span></strong><span lang=\"EN-GB\">diberikan pengecualian kewajiban memiliki SIUP berdasarkan kriteria atau jenis usahanya. Berikut kriteria usaha yang mendapat pengecualian kewajiban memiliki SIUP:</span></p>\r\n<ol start=\"1\" type=\"1\">\r\n<li class=\"MsoNormal\"><span lang=\"EN-GB\">Perusahaan yang melakukan kegiatan usaha di luar sektor perdagangan</span></li>\r\n<li class=\"MsoNormal\"><span lang=\"EN-GB\">Kantor Cabang atau Kantor Perwakilan</span></li>\r\n<li class=\"MsoNormal\"><span lang=\"EN-GB\">Perusahaan perdagangan mikro dengan kriteria sebagai berikut:</span></li>\r\n<ul type=\"disc\">\r\n<li class=\"MsoNormal\"><span lang=\"EN-GB\">Jenis usaha Perseorangan atau persekutuan;</span></li>\r\n<li class=\"MsoNormal\"><span lang=\"EN-GB\">Kegiatan usaha diurus, dijalankan atau dikelola oleh pemiliknya atau anggota keluarga terdekat dan;</span></li>\r\n<li class=\"MsoNormal\"><span lang=\"EN-GB\">Memiliki kekayaan bersih paling banyak Rp50.000.000 (tidak termasuk tanah dan bangunan).</span></li>\r\n</ul>\r\n</ol>\r\n<p><span lang=\"EN-GB\">Namun jika ada perdagangan atau usaha mikro yang ingin memiliki SIUP, maka dapat diberikan SIUP Mikro. Sehingga khusus untuk jenis usaha mikro, SIUP merupakan dokumen pilihan yang bersifat tidak wajib untuk dimiliki.</span></p>', 14, 13, 1, 2, 1, '2022-10-06 12:10:29'),
