INSERT INTO `sambutan` (`id`, `pemberi_sambutan`, `isi_sambutan`, `foto_pimpinan`, `created_at`) VALUES
(1, 'Kepala Dinas', '<p><strong><span style=\"font-size: 14pt;\">Assalamu \'alaikum Wr. Wb.</span></strong></p>\r\n<p><strong><span style=\"font-size: 14pt;\">&ldquo;Melayani Tanpa Sekat&rdquo;</span></strong></p>\r\n<p style=\"text-align: justify;\">Gula Manista merupakan akronim yang mempunyai makna Penguatan UMKM Lokal Menuju Ekonomi Kreatif Berbasis Digital. Dalam hal ini, saya selaku Kepala Dinas Kominfo Kota Baubau, meneruskan program Kementrian Kominfo tentang Digitalisasi Enterpreneur Academic (DEA) yang dibentuk pada tahun 2020 sebagai langkah awal untuk mempercepat bangkitnya eknomi pasca pandemi covid.</p>\r\n<p style=\"text-align: justify;\">Klinik Gula Manista UMKM Kota Baubau merupakan inovasi yang akan menjadi wadah bagi UMKM Kota Baubau untuk mendapatkan informasi dan berinteraksi berbasis digital kepada pemerintah sehingga diharapkan UMKM yang ada di kota baubau dapat terus berkembang maju.</p>\r\n<p><strong><span style=\"font-size: 14pt;\">Wassalamu \'alaikum Wr. Wb.</span></strong></p>', 'kepala-dinas.jpeg', '2022-09-16 17:29:32');
